import React from "react";
import { Component } from "react";
import { Form, Button } from "react-bootstrap";

class AddProject extends Component {

  state = {
    title: "",
    description: "",
    techStack: "",
    github: "",
    link: "",
    difficulty: "",
    field: ""
  }

  changeFieldsHandler = (name) => (event) => {
    let newState = { ...this.state };
    newState[name] = event.target.value;
    this.setState(newState);
  };

  render() {
    return (
      <Form >
        <Form.Group controlId="formBasicTitle">
          <Form.Label>Title</Form.Label>
          <Form.Control name="title" type="title" />
        </Form.Group>
        <Form.Group controlId="formBasicDescription">
          <Form.Label>Description</Form.Label>
          <Form.Control name="description" type="description" />
        </Form.Group>
        <Form.Group controlId="formBasicTechStack">
          <Form.Label>Tech Stack</Form.Label>
          <Form.Control name="techStack" type="techStack" />
        </Form.Group>
        <Form.Group controlId="formBasicGithub">
          <Form.Label>Github</Form.Label>
          <Form.Control name="github" type="github" />
        </Form.Group>
        <Form.Group controlId="formBasicLink">
          <Form.Label>Link</Form.Label>
          <Form.Control name="link" type="link" />
        </Form.Group>
        <Form.Group controlId="formBasicDifficulty">
          <Form.Label>Difficulty</Form.Label>
          <Form.Control name="difficulty" type="difficulty" />
        </Form.Group>
        <Form.Group controlId="formBasicField">
          <Form.Label>Field</Form.Label>
          <Form.Control name="field" type="field" />
        </Form.Group>
        <Button onClick={this.submitHandler} variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    );
  }
};

export default AddProject;
